import * as React from "react"
import ReactDOM from 'react-dom';


// 1. import `ChakraProvider` component
import { Box, ChakraProvider } from "@chakra-ui/react"

function App() {
  // 2. Use at the root of your app
  return (
    <ChakraProvider>
      <App />
      <Box w="500px" h="15vh" bg="blue">

      </Box>
    </ChakraProvider>
  )
}

export default App ;
